import React from 'react';
import './Components.css';

const logopath = 'https://yt3.ggpht.com/dmhaqh0U3g3_lovb78OkS7XVyF_SjnovXrh8aUzWa_A-jZ05sZSeLvcWe8Bie3GlxM7Mw907aio=s88-c-k-c0x00ffffff-no-rj'


const HeaderMenu = () => {
  return (
    <nav  className="Header-menu-class">
        <ul className="Header-menu-class">
            <a href="/" aria-current="page" aria-label="home">
                {/* <img src="https://uploads-ssl.webflow.com/62bebfb83044de7f13ae257e/62bec02423796903b293473e_Logo.svg" loading="lazy" alt=""/> */}
                <img src={logopath} loading="lazy" alt=""/>
            </a>
            <li className="Header-menu-option-class">
                <a href={'https://bcnvision.es/es?gclid=Cj0KCQiAzeSdBhC4ARIsACj36uF04pB6BdgsBTLgQGcI_-y3DCtNvjoCtkpkcvwjhh2k-HXWJ-V_NZEaAsQ4EALw_wcB'} >Home</a>
            </li>
            <li className="Header-menu-item-class">
                <a>Vision System Manager</a>
            </li>
            <li className="Header-menu-item-class">
                <a>Deep Learning Tools</a>
            </li>
            <li className="Header-menu-item-class">
                <a>Cortex Control Panel</a>
            </li>
        </ul>
    </nav>
  );
}

export default HeaderMenu;
